import "./../../../App.css"

import class_myposts from "./MyPosts.module.css"

let way = "C:/New_folder/React/Projects/1_First_project/react_first/src/App.css";
const MyPosts = () =>{
    return (
      <div className="my_posts">
        <div className="new_post">
          
          <div className={class_myposts.post}>
            <div>post 1</div>
            <div>post 2</div>
            <div>post 3</div>
            <div>post 4</div>
            <div>post 5</div>
          </div>
          New post
        </div>
        My posts
      </div>
    );

};

export default MyPosts;
